import Object = require('nashorn/java/lang/Object');
import CachedValueProvider = require('nashorn/com/intellij/psi/util/CachedValueProvider');

declare class CachedValue<T> extends Object {
	value : T;
	valueProvider : CachedValueProvider<T>;
	getValue() : T;
	getValueProvider() : CachedValueProvider<T>;
	hasUpToDateValue() : boolean;
}

export = CachedValue
